import React, { Component } from "react";

export default class TechComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="techStack">
        <h2 className="techHeader">Technologies I've worked with:</h2>
        <div className="allSkills">
          <div className="stackType">
            Front-end
            <p>React</p>
            <p>Redux</p>
            <p>HTML</p>
            <p>CSS</p>
          </div>
          <div className="stackType">
            Back-end
            <div className="techIcons">
              <img src="/techIcons/nodejs.png" />
              Node
            </div>
            <div className="techIcons">
            <img src="/techIcons/express.jpg" />
                Express</div>
            <div>Sequelize</div>
            <div>MongoDB</div>
            <div>Mongoose</div>
            <div>PostgreSQL</div>
          </div>
        </div>
      </div>
    );
  }
}
